import React from "react";
import {Link} from "react-router-dom";

function NavBar() {
    return (
        <nav style = {{
            padding : "10px",
            backgroundColor : "#f0f0f0",
            display : "flex",
            alignItems : "center",
            justifyContent : "space-between"
        }}>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/tracker">Tracker</Link>
                </li>
            </ul>
        </nav>
    );
}

export default NavBar;
